import{u as t}from"./use-meta.e49711e2.js";import{z as e,A as r,M as a}from"./index.b9c3de56.js";const s={class:"content"},o=a('<div class="text"><div class="p_title">\u0418\u0441\u0442\u043E\u0440\u0438\u044F</div><br> \u042E\u0436\u043D\u043E-\u0421\u0430\u0445\u0430\u043B\u0438\u043D\u0441\u043A\u0438\u0439 \u041A\u0430\u043C\u0435\u0440\u043D\u044B\u0439 \u041E\u0440\u043A\u0435\u0441\u0442\u0440 \u043E\u0441\u043D\u043E\u0432\u0430\u043D \u0432 1999 \u0433\u043E\u0434\u0443 \u0437\u0430\u0441\u043B\u0443\u0436\u0435\u043D\u043D\u044B\u043C \u0440\u0430\u0431\u043E\u0442\u043D\u0438\u043A\u043E\u043C \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u044B \u0421\u0430\u0445\u0430\u043B\u0438\u043D\u0441\u043A\u043E\u0439 \u043E\u0431\u043B\u0430\u0441\u0442\u0438, \u0441\u043A\u0440\u0438\u043F\u0430\u0447\u043E\u043C <a href="/AlexandrZrazaev">\u0410\u043B\u0435\u043A\u0441\u0430\u043D\u0434\u0440\u043E\u043C \u0417\u0440\u0430\u0436\u0430\u0435\u0432\u044B\u043C</a>. \u0417\u0430 20 \u043B\u0435\u0442 \u0441\u0432\u043E\u0435\u0433\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E\u0432\u0430\u043D\u0438\u044F \u043A\u043E\u043B\u043B\u0435\u043A\u0442\u0438\u0432 \u0441\u0442\u0430\u043B \u043D\u0435\u043E\u0442\u044A\u0435\u043C\u043B\u0435\u043C\u043E\u0439 \u0447\u0430\u0441\u0442\u044C\u044E \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u043E\u0439 \u0436\u0438\u0437\u043D\u0438 \u0421\u0430\u0445\u0430\u043B\u0438\u043D\u0441\u043A\u043E\u0439 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0438 \u0414\u0430\u043B\u044C\u043D\u0435\u0432\u043E\u0441\u0442\u043E\u0447\u043D\u043E\u0433\u043E \u0440\u0435\u0433\u0438\u043E\u043D\u0430. \u0421 2016 \u0433\u043E\u0434\u0430 \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0438\u0442\u0435\u043B\u044C \u0438 \u0433\u043B\u0430\u0432\u043D\u044B\u0439 \u0434\u0438\u0440\u0438\u0436\u0435\u0440 \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u0430 <a href="/conductor">\u0422\u0438\u0433\u0440\u0430\u043D \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D</a>. <br><br>\u042E\u0421\u041A\u041E \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u0442 \u0431\u043E\u043B\u044C\u0448\u0443\u044E \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u0443\u044E \u0438 \u043F\u0440\u043E\u0441\u0432\u0435\u0442\u0438\u0442\u0435\u043B\u044C\u0441\u043A\u0443\u044E \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C, \u043D\u0430\u0441\u0447\u0438\u0442\u044B\u0432\u0430\u044E\u0449\u0443\u044E \u0431\u043E\u043B\u0435\u0435 700 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0439, \u043F\u043E\u0434\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u043E \u043C\u043D\u043E\u0433\u043E \u0441\u043E\u0432\u043C\u0435\u0441\u0442\u043D\u044B\u0445 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u044B\u0445 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0439 \u0441 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430\u043C\u0438 \u0438\u0437 \u0420\u043E\u0441\u0441\u0438\u0438, \u042F\u043F\u043E\u043D\u0438\u0438, \u042E\u0436\u043D\u043E\u0439 \u041A\u043E\u0440\u0435\u0438, \u0421\u0428\u0410, \u0418\u0437\u0440\u0430\u0438\u043B\u044F. \u041E\u0440\u043A\u0435\u0441\u0442\u0440 \u0438\u0433\u0440\u0430\u0435\u0442 \u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u043E \u043F\u0440\u0435\u043C\u044C\u0435\u0440\u043D\u044B\u0445 \u043D\u0430 \u0421\u0430\u0445\u0430\u043B\u0438\u043D\u0435 \u043F\u0440\u043E\u0433\u0440\u0430\u043C\u043C. \u0423\u0441\u043F\u0435\u0448\u043D\u043E \u0433\u0430\u0441\u0442\u0440\u043E\u043B\u0438\u0440\u043E\u0432\u0430\u043B \u0432 \u042F\u043F\u043E\u043D\u0438\u0438, \u042E\u0436\u043D\u043E\u0439 \u041A\u043E\u0440\u0435\u0435, \u041A\u0438\u0442\u0430\u0435, \u0421\u0435\u0440\u0431\u0438\u0438, \u0432\u044B\u0441\u0442\u0443\u043F\u0430\u0435\u0442 \u043D\u0430 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0445 \u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u0445 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0445 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044F\u0445 \u0438 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u044B\u0445 \u0442\u0443\u0440\u043D\u0435. <br><br>\u0412 2019\u0433. \u043E\u0440\u043A\u0435\u0441\u0442\u0440 \u043F\u043E\u0434 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u043E\u043C \u0422\u0438\u0433\u0440\u0430\u043D\u0430 \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D\u0430 \u0431\u044B\u043B \u043F\u0440\u0438\u0433\u043B\u0430\u0448\u0435\u043D \u043D\u0430 \u0433\u0430\u043B\u0430-\u043A\u043E\u043D\u0446\u0435\u0440\u0442 \u043F\u0440\u0435\u0441\u0442\u0438\u0436\u043D\u043E\u0433\u043E \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044F \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u042D\u043C\u0438\u0440\u0430 \u041A\u0443\u0441\u0442\u0443\u0440\u0438\u0446\u044B \xABKustendorf Classic\xBB \u0432 \u0421\u0435\u0440\u0431\u0438\u0438. \u0422\u0430\u043A\u0436\u0435 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u043E\u043C \u0437\u043D\u0430\u0447\u0438\u043C\u044B\u0445 \u0432\u0441\u0435\u0440\u043E\u0441\u0441\u0438\u0439\u0441\u043A\u0438\u0445 \u0438 \u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u0445 \u043A\u0438\u043D\u043E\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u0435\u0439, \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u043C\u044B\u0445 \u043D\u0430 \u043E\u0441\u0442\u0440\u043E\u0432\u0435: \xAB\u041A\u0440\u0430\u0439 \u0441\u0432\u0435\u0442\u0430\xBB \u0438 \xAB\u0423\u0442\u0440\u043E \u0420\u043E\u0434\u0438\u043D\u044B\xBB. <br><br>\u0421 \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u043E\u043C \u0432\u044B\u0441\u0442\u0443\u043F\u0430\u043B\u0438 \u0441\u043E\u043B\u0438\u0441\u0442\u044B \u0438 \u0434\u0438\u0440\u0438\u0436\u0451\u0440\u044B \u043C\u0438\u0440\u043E\u0432\u043E\u0433\u043E \u0443\u0440\u043E\u0432\u043D\u044F: \u0411\u043E\u0440\u0438\u0441 \u0410\u043D\u0434\u0440\u0438\u0430\u043D\u043E\u0432, \u041D\u0430\u0440\u0435\u043A \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D, \u041A\u0438\u043C \u0414\u0436\u043E\u043D \u0414\u043E\u043A, \u041A\u0438\u043C \u041D\u0430\u043D \u0421\u0435, \u0414\u043C\u0438\u0442\u0440\u0438\u0439 \u041A\u043E\u0433\u0430\u043D, \u0424\u0438\u043B\u0438\u043F\u043F \u041A\u043E\u043F\u0430\u0447\u0435\u0432\u0441\u043A\u0438\u0439, \u0421\u0435\u0440\u0433\u0435\u0439 \u041A\u0440\u0430\u0432\u0447\u0435\u043D\u043A\u043E, \u0410\u0440\u0442\u0443\u0440 \u041D\u0430\u0437\u0438\u0443\u043B\u043B\u0438\u043D, \u0425\u0438\u0440\u043E\u043A\u043E \u041D\u0438\u043D\u0430\u0433\u0430\u0432\u0430, \u041A\u043E\u043D\u0441\u0442\u0430\u043D\u0442\u0438\u043D \u041E\u0440\u0431\u0435\u043B\u044F\u043D, \u0422\u0430\u0442\u044C\u044F\u043D\u0430 \u041F\u0430\u0432\u043B\u043E\u0432\u0441\u043A\u0430\u044F, \u041D\u0438\u043A\u043E\u043B\u0430\u0439 \u041F\u0435\u0442\u0440\u043E\u0432, \u0410\u0439\u043B\u0435\u043D \u041F\u0440\u0438\u0442\u0447\u0438\u043D, \u041A\u0438\u0440\u0438\u043B\u043B \u0421\u043E\u043B\u0434\u0430\u0442\u043E\u0432, \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432 \u0421\u0443\u043B\u0438\u043C\u0441\u043A\u0438\u0439, \u0410\u043B\u0435\u043A\u0441\u0430\u043D\u0434\u0440 \u0422\u0440\u043E\u0441\u0442\u044F\u043D\u0441\u043A\u0438\u0439, \u0421\u0442\u0430\u043D\u0438\u0441\u043B\u0430\u0432 \u0422\u0440\u043E\u0444\u0438\u043C\u043E\u0432, \u0418\u0433\u043E\u0440\u044C \u0424\u0435\u0434\u043E\u0440\u043E\u0432, \u0410\u044F\u043A\u043E \u042F\u0441\u0443\u0434\u0430, \u0413\u0438\u044F \u042F\u0448\u0432\u0438\u043B\u0438. <br><br>\u041F\u043E\u0434 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u043E\u043C \u0422\u0438\u0433\u0440\u0430\u043D\u0430 \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D\u0430 \u043A\u043E\u043B\u043B\u0435\u043A\u0442\u0438\u0432 \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u043B \u0441\u043E\u0432\u043C\u0435\u0441\u0442\u043D\u044B\u0435 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u044B \u0441 \u0441\u0438\u043C\u0444\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u043E\u043C \u041C\u0430\u0440\u0438\u0438\u043D\u0441\u043A\u043E\u0433\u043E \u0442\u0435\u0430\u0442\u0440\u0430, \u0441\u0438\u043C\u0444\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u043E\u043C \u0425\u0430\u043A\u043E\u0434\u0430\u0442\u0435 (\u042F\u043F\u043E\u043D\u0438\u044F), \u0441\u0438\u043C\u0444\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438 \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u0430\u043C\u0438 \u0421\u0435\u0443\u043B\u0430, \u0421\u043E\u0447\u043E\u043D\u0430, \xABKYDO\xBB (\u042E\u0436\u043D\u0430\u044F \u041A\u043E\u0440\u0435\u044F). \u042E\u0421\u041A\u041E \u043F\u043E\u0434 \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0435\u043C \u0422\u0438\u0433\u0440\u0430\u043D\u0430 \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D\u0430, \u0441\u043E\u0432\u043C\u0435\u0441\u0442\u043D\u043E \u0441 \u0432\u0435\u0434\u0443\u0449\u0438\u043C\u0438 \u0441\u043E\u043B\u0438\u0441\u0442\u0430\u043C\u0438, \u0445\u043E\u0440\u043E\u043C \u0438 \u0430\u0440\u0442\u0438\u0441\u0442\u0430\u043C\u0438 \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u0430 \u041F\u0440\u0438\u043C\u043E\u0440\u0441\u043A\u043E\u0439 \u0441\u0446\u0435\u043D\u044B \u041C\u0430\u0440\u0438\u0438\u043D\u0441\u043A\u043E\u0433\u043E \u0442\u0435\u0430\u0442\u0440\u0430 \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u043B \u043F\u0435\u0440\u0432\u0443\u044E \u043E\u043F\u0435\u0440\u043D\u0443\u044E \u043F\u043E\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0443 \u043D\u0430 \u0421\u0430\u0445\u0430\u043B\u0438\u043D\u0435, \u043E\u043F\u0435\u0440\u0443 \u0414\u0436. \u0412\u0435\u0440\u0434\u0438 \xAB\u0421\u0438\u043C\u043E\u043D \u0411\u043E\u043A\u043A\u0430\u043D\u0435\u0433\u0440\u0430\xBB. \u0421\u043E\u0441\u0442\u043E\u044F\u043B\u0430\u0441\u044C \u0441\u0430\u0445\u0430\u043B\u0438\u043D\u0441\u043A\u0430\u044F \u043F\u0440\u0435\u043C\u044C\u0435\u0440\u0430 \u0434\u0435\u0442\u0441\u043A\u043E\u0439 \u0430\u043D\u0442\u0438\u0432\u043E\u0435\u043D\u043D\u043E\u0439 \u043E\u043F\u0435\u0440\u044B \xAB\u0411\u0440\u0443\u043D\u0434\u0438\u0431\u0430\u0440\xBB \u0413\u0430\u043D\u0441\u0430 \u041A\u0440\u0430\u0441\u0430. \u0412\u043F\u0435\u0440\u0432\u044B\u0435 \u043F\u0440\u043E\u0437\u0432\u0443\u0447\u0430\u043B \xAB\u0420\u0435\u043A\u0432\u0438\u0435\u043C\xBB \u0412.\u0410. \u041C\u043E\u0446\u0430\u0440\u0442\u0430, \u0441\u043E\u0432\u043C\u0435\u0441\u0442\u043D\u043E \u0441 \u0434\u0435\u0442\u0441\u043A\u0438\u043C \u0441\u0438\u043C\u0444\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043E\u0440\u043A\u0435\u0441\u0442\u0440\u043E\u043C \u042E\u0436\u043D\u043E\u0439 \u041A\u043E\u0440\u0435\u0438 KYDO. <br><br>\u041E\u0441\u043E\u0431\u043E\u0435 \u0432\u043D\u0438\u043C\u0430\u043D\u0438\u0435 \u0443\u0434\u0435\u043B\u044F\u0435\u0442\u0441\u044F \u0434\u0435\u0442\u0441\u043A\u0438\u043C \u0438 \u043C\u043E\u043B\u043E\u0434\u0435\u0436\u043D\u044B\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u043C \u043F\u0440\u043E\u0433\u0440\u0430\u043C\u043C\u0430\u043C. \u041F\u043E\u0434\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u044B \u0438 \u0438\u0441\u043F\u043E\u043B\u043D\u0435\u043D\u044B \u044D\u043A\u0441\u043A\u043B\u044E\u0437\u0438\u0432\u043D\u044B\u0435 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u043E-\u043B\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043D\u044B\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u044B \u0422\u0438\u0433\u0440\u0430\u043D\u0430 \u0410\u0445\u043D\u0430\u0437\u0430\u0440\u044F\u043D\u0430: \xAB\u0429\u0435\u043B\u043A\u0443\u043D\u0447\u0438\u043A\xBB (\u041F.\u0418 \u0427\u0430\u0439\u043A\u043E\u0432\u0441\u043A\u0438\u0439 - \u042D.\u0410. \u0413\u043E\u0444\u043C\u0430\u043D), \xAB\u0427\u0438\u043F\u043E\u043B\u043B\u0438\u043D\u043E\xBB (\u041A. \u0425\u0430\u0447\u0430\u0442\u0443\u0440\u044F\u043D \u2013 \u0414\u0436. \u0420\u043E\u0434\u0430\u0440\u0438), \xAB\u041F\u0435\u0442\u044F \u0438 \u0412\u043E\u043B\u043A\xBB (\u0421. \u041F\u0440\u043E\u043A\u043E\u0444\u044C\u0435\u0432). \u0412 2017\u0433. \u0431\u044B\u043B \u043F\u0440\u043E\u0432\u0435\u0434\u0435\u043D II \u0414\u0430\u043B\u044C\u043D\u0435\u0432\u043E\u0441\u0442\u043E\u0447\u043D\u044B\u0439 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044C \u0434\u043B\u044F \u0434\u0435\u0442\u0435\u0439 \u0438 \u044E\u043D\u043E\u0448\u0435\u0441\u0442\u0432\u0430, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u043C \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u043B\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u043E\u0434\u0430\u0440\u0435\u043D\u043D\u044B\u0435 \u0434\u0435\u0442\u0438 \u0441\u043E\u043B\u0438\u0441\u0442\u044B-\u0434\u0430\u043B\u044C\u043D\u0435\u0432\u043E\u0441\u0442\u043E\u0447\u043D\u0438\u043A\u0438. <br><br>\u042E\u0421\u041A\u041E \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u0442 \u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u043E \u044F\u0440\u043A\u0438\u0445 \u0442\u0435\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043E\u0432, \u0441\u0440\u0435\u0434\u0438 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \xAB\u041E\u043A\u043D\u043E \u0432 \u0415\u0432\u0440\u043E\u043F\u0443\xBB, \xAB\u041F\u0443\u0442\u0435\u0432\u043E\u0434\u0438\u0442\u0435\u043B\u044C \u043F\u043E \u0410\u043C\u0435\u0440\u0438\u043A\u0435\xBB, \xAB\u0424\u0435\u0439\u0435\u0440\u0432\u0435\u0440\u043A \u0442\u0430\u043D\u0446\u0435\u0432\xBB, \xAB\u0412 \u043C\u0438\u0440\u0435 \u0441\u043A\u0430\u0437\u043E\u043A\xBB, \xAB\u041E\u043F\u0435\u0440\u0430- \u0413\u0430\u043B\u0430\xBB \u0438 \u043C\u043D\u043E\u0433\u0438\u0435 \u0434\u0440\u0443\u0433\u0438\u0435, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043F\u043E\u043B\u0443\u0447\u0430\u044E\u0442 \u0432\u043E\u0441\u0442\u043E\u0440\u0436\u0435\u043D\u043D\u044B\u0439 \u043E\u0442\u043A\u043B\u0438\u043A \u043F\u0443\u0431\u043B\u0438\u043A\u0438. </div>',1),c=[o],m={__name:"HistoryPage",setup(i){return t({title:"\u0418\u0441\u0442\u043E\u0440\u0438\u044F"}),(_,b)=>(e(),r("div",s,c))}};export{m as default};
